class About extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="container text-center m-5">
                <div className="m-5">
                    <h1 className="m-5 h2">We pioneered the discount broking model in India.
                  <br />
                        Now, we are breaking ground with our technology.
                </h1>
                </div>
                <div className="row">
                    <div className="col-12 col-lg-6">
                        <p>We kick-started operations on the 15th of August, 2010 with the goal of
                             breaking all barriers that traders and investors
                             face in India in terms of cost, support, and technology. </p>
                        <p></p>
                    </div>
                    <div className="col-12 col-6"></div>

                </div>

            </div>
        )
    }
}


export default About;
